import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const Home = props => {
    return (
    <div>
        <div className='jumbotron'>
            <div className='container'>
                <h1 className="display-3">Taylor Cool</h1>
                <p className="lead">A Las Vegas, Nevada based Full Stack Web Developer</p>
            </div>
        </div>
    </div>
    );
}
export default Home;
